import React from 'react'
import Header from '../../header/header'

const Book = () => {
  return (
    <div>
      <Header />
      <h1>Book Page</h1>
      <button onClick={alert='Slot Booked Successfully'} style={{marginTop:'80px'}}>Book Slot</button>
    </div>
  )
}

export default Book
